TrulyHogtiedTH - May 06, 2012 - Ashley Graham   + Pics


It's time for another Hogtied Challenge! This week pits the lovely Ashley against Bane. She knows the rules, she knows the outcome if she fails. Once she's secured, Bane splashes her with water and hits the fan adding to her struggle, which proves too much to overcome. In Round Two, they up the ante, Ashley is given the chance at sweet revenge...Will she make the most of her opportunity


